R["oh__@tristorm"]="{['eu']={[16]={['N']='The Imperial Reserve',['O']=18864,['C']=1.010000,['D']='A small branch of \"The Imperial Reserve\" the greatest Banking & Mail service throughout the Cyrodillic Empire.\\nDeposit or Withdrawal? Ezabi can aide you in any way you may need.\\n=-=-=-=-=\\nA small bank, attempted to recreate the cosy feel of a traditional small village, English postal office.',},[89]={['N']='Castle Septimus',['O']=18863,['C']=1.017000,['D']='House Septimus - Castle Septimus - DLXXXII\\n=-=-=-=-=\\nSeptimus Castle is a large keep & chantry located to the north of Leyawiin sitting on the Silverfish River.\\nThe original construction of this keep dates back to the Reman Empire, and had no relation to the House of Septimus; instead being aquired by Caladius VII as of recent.\\nThis bastion stands as a beacon of Imperial strength, wealth and as a home to many museum-worthy relics.',},[43]={['N']='Ruhn Torval',['O']=18855,['C']=1.007000,['D']='Estate granted to the Ordinator Torval Indoril, for his services rendered to the Tribunal.',},[78]={['N']='Septimus Manor',['O']=18855,['C']=1.051000,['D']='The cosy home of Lord Caladius Septimus VII. A place to rest your soul after a weary days work.',},[79]={['N']='Ald Hame-Nuere',['O']=18855,['C']=1.048000,['D']='Underneath the seas of Summerset, lay Ald Hame-Nuere the fortress of the Vampire Nuerellion Ald Vampiris. Adventurers beware.',},},['Version']=1759,['TS']=1629907125,['Key']='oh__@tristorm',}"
