r']=120899,['Z']=121049,['X']=106577,['SizeY']=290,},[19]={['Yaw']=3.951425,['SizeX']=1900,['Id']=1117,['SizeZ']=1900,['Alpha']=0.060000,['Pitch']=1.570971,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=27,['Y']=35498,['Color']=254299,['Z']=121054,['X']=106577,['SizeY']=1900,},},['Version']='15.9.3',},[5]={['TS']=1613452189,['World']='eu',['HouseId']=60,['Effects']={[1]={['Yaw']=4.609415,['SizeX']=16,['Id']=1120,['SizeZ']=50.071111,['Alpha']=1,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=5040,['Y']=17921,['Color']=999999,['Z']=62034,['X']=69396,['SizeY']=34,},[2]={['Yaw']=0.907571,['SizeX']=26.767241,['Id']=1121,['SizeZ']=30,['Alpha']=1,['Pitch']=4.611160,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=5097,['Y']=17374,['Color']=999999,['Z']=62173,['X']=66765,['SizeY']=30,},[3]={['Yaw']=1.665044,['SizeX']=23.234043,['Id']=1122,['SizeZ']=30,['Alpha']=1,['Pitch']=1.497492,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=5105,['Y']=17368,['Color']=999999,['Z']=62107,['X']=66755,['SizeY']=30,},[4]={['MetaData']={['message']='The Log of Captain Lalla Ailani Al Ghurab\\n\\nSo this is a nice little cove we found after the battle with the maormer dogs. This ship of theirs that they took from the altmer will do nicely, it\\'s in much better repair than mine which took damage during the fracas. I had Kholat sail back to home port with my ship to get repairs. I think we will happily take this place and make it a home away from home. It seems to have been abandoned long ago and the maormer have driven anyone who would have come this way off, which is greatly to my advantage. I managed to smuggle/ship in some supplies from home.\\nWe are all due some hard earned rest and relaxation!',['title']='Captain\\'s Log',},['Yaw']=4.928810,['Pitch']=1.630138,['Id']=1127,['SizeZ']=30,['Alpha']=1,['SizeX']=26.456456,['Roll']=0,['EffectType']=8502,['Groups']=0,['Contrast']=1,['Y']=10069,['Color']=102439,['Z']=73256,['X']=75737,['SizeY']=30,},},['Version