ion.\\n\\nII. Authority\\nAccept decisions from the council, even if you don\\'t agree with them.\\nAll Professors Must Be Respected.\\nAll students of the college will coexist peacefully in the Hall of Attainment.\\n\\nIII. Rules and Procedures\\nProper Attire Are Required.\\nCrimes against fellow members of the College are treated with the harshest discipline. \\nWhether a member may regain their status in the College is determined by the Arch-Mage.\\nAny College member commiting a crime against the college is to be suspended immediately. \\nAny College member receiving multiple suspensions may, at the determination of the council, be summarily and permanently dismissed from the College.\\n\\nIV. Membership Requirements\\nThe College of Winterhold only accepts candidates of keen intelligence and dominant will. \\nAdmission is based largely on observed potential, attitude, skill, and the nature of answers given during the admission interview. \\n\\nV. Applications for Membership \\nCandidates must present themselves or send a letter to the Arch-Mage (@asdara) for examination and approval.',['title']='Rules of the College',},['SizeY']=30,['Roll']=0,['SizeX']=26.456456,['Groups']=0,['Pitch']=0,['Color']=779799,['Y']=29231,['EffectType']=8501,['SizeZ']=30,['Contrast']=1,['Id']=1411,['Alpha']=1,['Z']=97348,['X']=123611,['Yaw']=0.853466,},[15]={['MetaData']={['message']='   THE \\nARCANAEUM',},['SizeY']=140,['Roll']=0,['SizeX']=500,['Groups']=0,['Pitch']=0,['Color']=998521,['Y']=29779,['EffectType']=4405,['SizeZ']=140,['Contrast']=1,['Id']=1412,['Alpha']=0.750000,['Z']=97320,['X']=123635,['Yaw']=0.858702,},[16]={['MetaData']={['message']='   HALL\\n    OF\\nATTAINMENT',},['SizeY']=200,['Roll']=0,['SizeX']=500,['Groups']=0,['Pitch']=0,['Color']=998521,['Y']=31319,['EffectType']=4405,['SizeZ']=200,['Contrast']=1,['Id']=1413,['Alpha']=0.750000,['Z']=97320,['X']=123635,['Yaw']=0.858702,},[17]={['MetaData']={['message']='   HALL\\n    OF\\nCOUNTENANCE',},['SizeY']=200,['Roll