ping at my chamber door,\\nThat I scarce was sure I heard you\", here I opened wide the door;\\n\\nDarkness there and nothing more.\\n\\nThen this ebony bird beguiling my sad fancy into smiling,\\nBy the grave and stern decorum of the countenance it wore,\\n\"Though thy crest be shorn and shaven, thou,\" I said, \"art sure no craven,\\nGhastly grim and ancient Raven wandering from the Nightly shore,\\n\\nTell me what thy lordly name is on the Night\\'s Plutonian shore!\"\\n\\nQuoth the Raven  \"Nevermore\".',},['EffectType']=8502,['Groups']=0,['Z']=47994,['SizeY']=30,['Id']=1129,['Yaw']=3.455752,['Pitch']=4.712564,['Contrast']=1.880000,['SizeX']=26.456460,['X']=53133,['Color']=102439,['Y']=10199,['Alpha']=1,['SizeZ']=30,},[23]={['Roll']=0,['Pitch']=0,['Groups']=0,['Z']=50047,['SizeY']=400,['Yaw']=4.502949,['Id']=1130,['Alpha']=1,['Color']=999999,['SizeX']=340,['X']=54090,['Contrast']=1,['Y']=15323,['EffectType']=4581,['SizeZ']=400,},[24]={['Roll']=0,['Pitch']=3.148574,['Groups']=0,['Z']=49016,['SizeY']=128,['Yaw']=4.003785,['Id']=1131,['Alpha']=1,['Color']=999999,['SizeX']=128,['X']=50991,['Contrast']=1,['Y']=15604,['EffectType']=516,['SizeZ']=128,},},['Version']='16.0.6',['TS']=1608634179,['World']='na',},[2]={['HouseId']=39,['Effects']={[1]={['Roll']=0,['Yaw']=2.443461,['Groups']=0,['Z']=26601,['SizeY']=128,['Id']=1133,['EffectType']=513,['Alpha']=0.600000,['Color']=0,['SizeX']=128,['X']=78829,['Contrast']=1,['Y']=4618,['Pitch']=0,['SizeZ']=128,},[2]={['Roll']=0,['Yaw']=5.672320,['Groups']=0,['Z']=24213,['SizeY']=150,['Id']=1134,['EffectType']=828,['Alpha']=0.820000,['Color']=995001,['SizeX']=300,['X']=80687,['Contrast']=1.330000,['Y']=4450,['Pitch']=0,['SizeZ']=150,},[3]={['Roll']=0,['Yaw']=5.672320,['Groups']=0,['Z']=24254,['SizeY']=160,['Id']=1135,['EffectType']=5075,['Alpha']=0.460000,['Color']=797900,['SizeX']=156.867470,['X']=80763,['Contrast']=1,['Y']=4410,['Pitch']=0,['SizeZ']=160,},[4]={['Roll']=0,['Yaw']=4.886922,['Groups']=0,['Z']=24815,['SizeY']=76,['I